import React from 'react'
import './OptionCell.styles.css'

export const OptionCell: React.FC<{ children: any, className?: string }>=({children, className}) => {
	return (
		<>
			<div className="Container">
				<div className={'before'}>-</div>
				<div className={'central-block'}>{children}</div>
				<div className={'after'}>-</div>
			</div>
		</>
	)
}
